import { makeStyles } from '@material-ui/core/styles';

export default makeStyles((theme) => ({
  root: {
    '& .MuiTextField-root': {
      margin: theme.spacing(1),
    },
    color: "#000",
  },
  paper: {
    padding: theme.spacing(2),
    color: "#fff",
  },
  form: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'center',
    color: "#fff",
  },
  fileInput: {
    width: '97%',
    margin: '10px 0',
    color: "#fff",
  },
  buttonSubmit: {
    marginBottom: 10,
  },
}));
